    @Test
    public void testGetUser() {
        String objectId = "EE72B06F0D20FE4D87D907A0A4F7BCAE";
        String quotedId = JsonUtilities.addQuotes(objectId);
        String responseJson = "{\"success\":{" +
                quotedId + ":{" +
                "\"__type__\":\"user\",\"__id__\":" + quotedId + "}}, " +
                "\"errors\":{}}";
        CMObjectResponse response = new CMObjectResponse(responseJson, 200);
        List<CMObject> objects = response.getObjects();
        assertEquals(1, objects.size());
        assertEquals(objectId, objects.get(0).getObjectId());

    }

